import "./Service.css";

function Service() {
  return (
    <div className='service' id='service'>
      <h2 className='heading'>Services</h2>

<div className='service-container'>
<div className='service-box'>
<div className='service-info'>
<h4>Frontend developer</h4>

</div>
</div>
</div>

    </div>
  )
}

export default Service
